import React from 'react';
import styled from 'styled-components';
import {FaFacebookSquare,FaTwitterSquare,FaInstagram,FaYoutube} from 'react-icons/fa';
import Logo from '../../Images/Logo/SpinzerLogoGolgenSilver.png';



const Container=styled.div`
margin: 0;
padding:0;
box-sizing: border-box;
display: flex;
justify-content: flex-end;
//align-items: center;
flex-direction: column;
background-color: #7f7f7f;
li{
    list-style: none;
    
}
`;
const SecAboutUs=styled.div``;
const Footer = () => {
    return (
      <Container>
          <SecAboutUs>
              <h2>About Us</h2>
              <p>
                  Lorem ipsum dolor sit amet consectetur adipisicing elit. 
                  Accusamus sed id deserunt officiis eum rerum commodi, autem odit possimus delectus quidem error natus? 
                  Harum vel id eius debitis! Quia, fugiat!
              </p>
          </SecAboutUs>
          <ul className='Sci'>
              <li><a href="../"><FaFacebookSquare/></a></li>
              <li><a href="../"><FaTwitterSquare/></a></li>
              <li><a href='../'><FaInstagram/></a></li>
              <li><a href='../'><FaYoutube/></a></li>
          </ul>
      </Container>

    )
}

export default Footer
